import React, { useState, useEffect, useRef } from 'react';
import Matter from 'matter-js';

const BookShelf = () => {
  const [selectedBook, setSelectedBook] = useState(null);
  const [showContent, setShowContent] = useState(false);
  const sceneRef = useRef(null);
  const engineRef = useRef(null);
  const renderRef = useRef(null);

  const books = [
    { 
      id: 1, 
      title: "DOT LINE SHAPE", 
      height: "h-64", 
      width: "w-16",
      content: "Exploring the fundamental elements of design through geometric principles and visual harmony."
    },
    { 
      id: 2, 
      title: "GRAPHIC FEST", 
      height: "h-80", 
      width: "w-14",
      content: "A celebration of contemporary graphic design and festival aesthetics in modern culture."
    },
    { 
      id: 3, 
      title: "GRAPHITE", 
      height: "h-48", 
      width: "w-24",
      content: "The art of pencil and charcoal, examining traditional drawing techniques in the digital age."
    },
    { 
      id: 4, 
      title: "NEW FOLK ART", 
      height: "h-72", 
      width: "w-20",
      content: "Contemporary interpretations of traditional folk art patterns and methodologies."
    }
  ];

  useEffect(() => {
    // Matter.js module aliases
    const Engine = Matter.Engine;
    const Render = Matter.Render;
    const World = Matter.World;
    const Bodies = Matter.Bodies;
    const Mouse = Matter.Mouse;
    const MouseConstraint = Matter.MouseConstraint;

    // Create an engine
    const engine = Engine.create();
    engineRef.current = engine;

    // Create a renderer
    const render = Render.create({
      element: sceneRef.current,
      engine: engine,
      options: {
        width: window.innerWidth,
        height: window.innerHeight,
        background: '#2563eb', // Tailwind blue-600
        wireframes: false
      }
    });
    renderRef.current = render;

    // Create ground
    const ground = Bodies.rectangle(window.innerWidth / 2, window.innerHeight, window.innerWidth, 60, {
      isStatic: true,
      render: {
        fillStyle: 'white'
      }
    });

    // Create book bodies
    const bookBodies = books.map((book, index) => {
      return Bodies.rectangle(
        window.innerWidth / 2 + (index - 1.5) * 100, 
        100, 
        50, 
        150, 
        {
          render: {
            fillStyle: 'white',
            text: {
              content: book.title,
              color: '#2563eb',
              size: 12
            }
          },
          friction: 0.3,
          restitution: 0.6
        }
      );
    });

    // Add mouse control
    const mouse = Mouse.create(render.canvas);
    const mouseConstraint = MouseConstraint.create(engine, {
      mouse: mouse,
      constraint: {
        stiffness: 0.2,
        render: {
          visible: false
        }
      }
    });

    // Add all bodies to the world
    World.add(engine.world, [ground, ...bookBodies, mouseConstraint]);

    // Run the renderer
    Render.run(render);

    // Create runner
    const runner = Matter.Runner.create();
    Matter.Runner.run(runner, engine);

    // Cleanup function
    return () => {
      Render.stop(render);
      Matter.Runner.stop(runner);
      World.clear(engine.world);
      Engine.clear(engine);
    };
  }, []);

  const handleBookClick = (bookId) => {
    if (selectedBook === bookId) {
      setShowContent(false);
      setTimeout(() => {
        setSelectedBook(null);
      }, 500);
    } else {
      setSelectedBook(bookId);
      setTimeout(() => {
        setShowContent(true);
      }, 500);
    }
  };

  const selectedBookData = books.find(b => b.id === selectedBook);

  return (
    <div className="w-full min-h-screen overflow-hidden relative">
      <div ref={sceneRef} className="absolute inset-0 z-0"></div>
      
      {showContent && selectedBookData && (
        <div 
          className={`
            fixed inset-0 bg-white z-10
            transition-transform duration-500 ease-in-out
            ${showContent ? 'translate-y-0' : 'translate-y-full'}
          `}
        >
          <div className="max-w-4xl mx-auto p-8 h-full flex flex-col">
            <div className="flex justify-between items-start mb-8">
              <h2 className="text-blue-600 text-4xl font-mono tracking-wider font-bold">
                {selectedBookData.title}
              </h2>
              <button 
                onClick={() => handleBookClick(selectedBook)}
                className="text-blue-600 hover:text-blue-800 transition-colors duration-300"
              >
                <svg 
                  className="w-8 h-8" 
                  fill="none" 
                  stroke="currentColor" 
                  viewBox="0 0 24 24"
                >
                  <path 
                    strokeLinecap="round" 
                    strokeLinejoin="round" 
                    strokeWidth={2} 
                    d="M6 18L18 6M6 6l12 12" 
                  />
                </svg>
              </button>
            </div>
            <div className="flex-1 overflow-auto">
              <p className="text-blue-600 font-mono text-lg leading-relaxed">
                {selectedBookData.content}
              </p>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default BookShelf;
